import React from 'react';
import '../App.css';
import {  Link } from "react-router-dom";

const Navbar= () =>{
  return (
  <div >
    <li className="Navbar">
      <Link className="Buttons" to="/Login">Log in</Link>
    </li>
  </div>
  );
}
export default Navbar;
